import { Rating } from 'react-simple-star-rating'

export default function ratingStar() {
  const [rating, setRating] = useState(0) // initial rating value


  return (
    <div className='App'>
      <Rating ratingValue={rating}/* Rating Props */ />
    </div>
  )
}
